import React from "react";

const List = ({ people }) => {
  return (
    <div>
      {people.map((person) => {
        const { id, name, age, image } = person;
        return (
          <article key={id} className="flex mt-5 ml-12">
            <img
              className="w-16 h-16 rounded-full  shadow-sm shadow-gray-900"
              src={image}
              alt={name}
            />
            <div className="ml-4">
              <h4 className="font-bold mt-2">{name}</h4>
              <p className="opacity-50">{age} Years</p>
            </div>
          </article>
        );
      })}
    </div>
  );
};

export default List;
